import React from 'react'

let a
let b

function add(a, b) {
  let sum = a + b
  return sum
}

function sub(a, b) {
  let sub = a - b
  return sub
}

function dive(a, b) {
  let dive = a / b
  return dive
}

function mult(a, b) {
  let mult = a * b
  return mult
}

export default add
export { sub, dive, mult }
